const LoginComp = () => {
    return (
        <div id="login-wrapper">
            <form className="login-form">
                <h1 className="login__title">SIGN IN</h1>
                <div className="inputGroup">
                    <input type="text" name="loginUser" className="login__user" required />
                    <label for="loginUser">User Name</label>
                </div>
                <div className="inputGroup">
                    <input type="password" name="loginPassword" className="login__password" required />
                    <label for="loginPassword">Password</label>
                </div>
                <input type="button" value="login" class="btn" />
                <a href="#" class="forgetPassWord">
                    Forget password?
                </a>
            </form>
        </div>
    );
};

export default LoginComp;
